import React from 'react'
import * as C from "./style"

function ResumeItems() {
  return (
    <C.Container>
        <C.Header>
            <C.HeaderTitle>Teste</C.HeaderTitle>
        </C.Header>
        <C.Total>1000</C.Total>
    </C.Container>
  )
}

export default ResumeItems
